import React from 'react';

const SummaryStats = ({ stats }) => {
  return (
    <div className="mt-4 p-4 bg-gradient-to-r from-purple-100 to-red-100 rounded-lg border border-red-300 shadow-lg">
      <h2 className="font-bold text-purple-700 mb-2">Dashboard Health Summary</h2>
      <div className="grid grid-cols-3 gap-4">
        <div className="text-center p-3 bg-white rounded-lg shadow-md border-t-4 border-blue-500">
          <p className="text-sm text-gray-600 font-semibold">Total Metrics</p>
          <p className="text-3xl font-bold text-blue-600">{stats.totalMetrics}</p>
        </div>
        <div className="text-center p-3 bg-white rounded-lg shadow-md border-t-4 border-red-500">
          <p className="text-sm text-gray-600 font-semibold">Vanity Metrics</p>
          <p className="text-3xl font-bold text-red-600">{stats.vanityMetrics}</p>
        </div>
        <div className="text-center p-3 bg-white rounded-lg shadow-md border-t-4 border-orange-500">
          <p className="text-sm text-gray-600 font-semibold">% Vanity</p>
          <p className="text-3xl font-bold text-orange-600">{stats.percentVanity}%</p>
        </div>
      </div>
    </div>
  );
};

export default SummaryStats;
